import Companies from '../Component/Company';
import Indicators from '../Component/Indicators';
import StopLoss from '../Component/StopLoss';
import { Space, Button } from 'antd'
import { useState } from 'react';

const CreateComplete = ({ company, indicator, rate, stopProfit, stopLoss, setClickInd, setClickCreate }) => {

    return(
        <div className='create'>
            <h3>策略已創建</h3>
            <Button onClick={()=>{setClickInd(true); setClickCreate(false);}}>回上頁</Button>
        </div>
    )
}

export default CreateComplete
